import React from "react";
import "./homeStyle.scss";
import { Link } from "react-router-dom";
import Button from "@material-ui/core/Button";
import {Swiper, SwiperSlide} from 'swiper/js/swiper.esm.bundle';

export default class HobbiesPage extends React.Component {
  render() {
    return (
      <div className="page-container page">
        <div className="home-page inner-container">
          <div className="welcome-container">
            <Link to="/">
              <Button>Home</Button>
            </Link>
            <Link to="/professional">
              <Button>Professional</Button>
            </Link>
            <Swiper>
            <div slot="before-wrapper">Before Wrapper</div>
            <div slot="after-wrapper">After Wrapper</div>
            <SwiperSlide>Default Slot</SwiperSlide>
          </Swiper>
          </div>
        </div>
      </div>
    );
  }
}
